import React from "react";
import Header from "./components/Header";
import Card from "./components/Card";
import "./App.css";

import charList from "./components/json/simpsons.json";

class App extends React.Component {
  state = {
    charArr: charList,
    Score: 0,
    TopScore: 0
  };
  render() {
    return [
      <Header />,

      <main>
        <Card pokemons={this.state.charArr} />
      </main>
    ];
  }
}

export default App;
